import Search from "./Search";

export default function Topbar() {
  return (
    <div className="TopBar">
      <Search />
      <div className="SideBarUserInfo">
        <img
          id="user_picture"
          className="SideBarUserPicture"
          src={userPicture}
          alt="User"
        />
        <p id="user_name">Fernando Alonso</p>
      </div>
    </div>
  );
}
